  const friends = initialFriends;

  return (
    <div className="">
      <ul>
        {friends.map((friend) => (
          <Friends friend={friend} KEY />
        ))}
      </ul>
    </div>
  );
}


function Friends({friend}){
  return (
    <li>
      <label>{friend.name}</label>
      <label>Data</label>
      <button>Select</button>
    </li>
  );
}
